import "./Board.css"

export default function (props) { 

    const handleOnClick = () => {
        if(props.letterList.contains(props.char)){
            console.log("contains " + props.char)
        }
    }

    return (
        <div key={props.char} className="key" onClick={handleOnClick}>{props.char}</div>
    )
}
